import React from 'react';

const ContactsPage = () => {
  return (
    <div>
      <h2>Contact Us</h2>
      <p>Email: example@example.com</p>
      <p>Phone: (123) 456-7890</p>
    </div>
  );
};

export default ContactsPage;
